import React, { Component } from "react";

class Test extends Component {
  constructor(props) {
    super(props);
    this.state = {
      itesm: [],
      isLoaded: false,
    }
  }

  didMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => res.json())
      .then(json => {
        this.setState({
          isLoaded:true,
          items: json,
        })
      });
  }
  
  render() {

    var{ isLoaded, items} = this.state;
    if(!isLoaded) {
      return <div>Loading...</div>
    }
    else {
      return(
        <div className ="Test">
            Data loaded
        </div>
      );
    }
    
  }

};

export default Test;
